import React, { Component } from 'react';
import { Link } from 'react-scroll';
import '../styling/navbar.css'

class NavigationBar extends Component {
    render() {
        return (
            <div className="navbar">
                <header id="navigationBar">
                    <ul>
                        <li className="navbar-item">
                            <Link
                                activeClass="active"
                                to="main"
                                spy={true}
                                smooth={true}
                                offset={0}
                                duration={500}
                            >Main</Link>
                        </li>
                        <li className="navbar-item">
                            <Link
                                activeClass="active"
                                to="projects"
                                spy={true}
                                smooth={true}
                                offset={0}
                                duration={500}
                            >Projects</Link>
                        </li>
                        <li className="navbar-item">
                            <Link
                                activeClass="active"
                                to="about"
                                spy={true}
                                smooth={true}
                                offset={0}
                                duration={500}
                            >About</Link>
                        </li>
                        <li className="navbar-item">
                            <Link
                                activeClass="active"
                                to="contact"
                                spy={true}
                                smooth={true}
                                offset={0}
                                duration={500}
                            >Contact</Link>
                        </li>
                    </ul>
                </header>
            </div>
        )
    }
}

export default NavigationBar;
